import React from 'react';
import './App.css';
import './Components/Button/Button';

const tabs = ["US", "World", "Politics", "Business", "Health", "Entertainment", "Opinion"];

function createTabButtons() {
  var result = (<nav></nav>);
  for (var i = 0; i < tabs.length; i++) {
    result += (<li>hello</li>);
  }
  return result;
}

function App() {
  return (
    <nav>
      <ul>
        {tabs.map((tab) => { <li>tab</li> })}
      </ul>
    </nav>
  );
}

export default App;
